import * as React from "react";
import { ButtonTile as ButtonTileProps } from "../model";

export default function ButtonTile({
  elementKey,
  text,
  action,
}: ButtonTileProps) {
  return (
    <div>
      <button id={elementKey}>{text}</button>
    </div>
  );
}
